import React, { useState } from 'react';
import { axiosWithAuth } from '../components/axiosWithAuth';

const getUserInfo = () => {
  const [state, setState] = useState();

  axiosWithAuth()
  .get('http://localhost:2019/getuserinfo')
  .then(res => {
  setState({state : res.data})
    })
    .catch(err => {
      debugger
    })
    .finally(() => {
      console.log(state)
    })
}

export default getUserInfo;
